void stringToImage(string stringToImage){//http://www.nullterminator.net/gltexture.html
	int width, height;
		width=256;height=256;
	int size=width*height*3;
	GLuint texture=0;texture+=1;
	
	unsigned char final[size];
	string currentDecimalSet="\0";
	int currentDecimalSetCount=0;
	for(int n=0;n<stringToImage.length();n++){
		if(stringToImage[n]!=' ')currentDecimalSet+=stringToImage[n];
		if(stringToImage[n]==' '){
			int convertMe=0;
			istringstream(currentDecimalSet)>>convertMe;
			final[currentDecimalSetCount]=(unsigned char)convertMe;
			currentDecimalSetCount+=1;
			currentDecimalSet="\0";
		}
	}
		glGenTextures(1,&texture);
		glBindTexture(GL_TEXTURE_2D,texture);
		gluBuild2DMipmaps(GL_TEXTURE_2D, 3, width, height,GL_BGR, GL_UNSIGNED_BYTE,final);
	texture__[count]=texture;
	memset(final,0,size);
	count+=1;
//return texture;
}
void IMAGE(){
	if(init==1){								//null=0;	null											
		if(count==0){stringToImage(testA());}	//grass=1;	0
		if(count==1){stringToImage(testA());}	//rock=2;	1
		if(count==2){stringToImage(testA());}	//tree=3;	2
		if(count==3){stringToImage(testA());}	//test=4;	3
		if(count==4){stringToImage(testA());}	//16x16=4;	4
		for(int n=0;n<5;n++)test[n]="\0";//reset the string images to save memory;
		count=0;
		int count2=0;
		for(int o=0;o<9;o++){
			for(int n=0;n<1620;n++){//47;//10000;///////2500 
					index[count2]=count2+1;;
				glNewList(index[count2], GL_COMPILE);
				glBindTexture(GL_TEXTURE_2D,texture__[MAP[o][n]-1]);
						glBegin(GL_QUADS);
							glTexCoord2d(0.0,0.0); glVertex2d(0.0,0.0);
							glTexCoord2d(1.0,0.0); glVertex2d(fac,0.0);//.2
							glTexCoord2d(1.0,1.0); glVertex2d(fac,fac);
							glTexCoord2d(0.0,1.0); glVertex2d(0.0,fac);
						glEnd();
				glEndList();
				count2+=1;
			}
		}
	}
}
